import React from 'react';

const HeroHomepage = () => {
  return (
    <div>
      <div className='relative'>
        <div className='picture-overlay w-full absolute h-full inset-0'>
        <img className='absolute object-cover w-full h-full' src='./images/bg.jpeg' alt='Background'></img>

          <div className='gradient-overlay absolute inset-0' style="background: linear-gradient(180deg, rgba(1, 6, 12, 0.90) -19.2%, rgba(1, 6, 12, 0.00) 100%);
mix-blend-mode: multiply;"></div>
        </div>
        <div className='relative w-screen overflow-x-hidden px-[5vw] md:px-[10vw] py-[35vh] sm:py-[25vh]'>
          <div className='HeroText text-left w-full'>
            <h1 className='text-[white] font-sofia leading-[1em] font-black text-[60px] sm:text-[100px] md:text-[120px] lg:text-[135px] pb-[0.1em] '>Some Cool <br></br> Text Here</h1>
            <a className='btn-solid' href=''>Join</a>
          </div>
        </div>
      </div>    
    </div>
  );
}

export default HeroHomepage;
